import React from 'react';
import {
   Link
} from "react-router-dom";


function Menu() {
  return (
    <nav role="navigation" aria-label="Navigation Tab">
    <ul>
        <li><button to="/">Homepage</button></li>
        <li><button itemProp="url" to="/about">About</button></li>
        <li><button itemProp="url" to="/login">Login</button></li>
        <Link to="/login">
          <button>Login</button>
        </Link>
        <Link to="/signup">
          <button>Signup</button>
        </Link>
     </ul>
</nav>


  );
}

export default Menu;
